import React, { useState, useEffect } from 'react';
import { useParams, Link } from 'react-router-dom';
import { Line } from 'react-chartjs-2';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import { 
  Chart as ChartJS, 
  CategoryScale, 
  LinearScale, 
  PointElement, 
  LineElement, 
  Title, 
  Tooltip, 
  Legend 
} from 'chart.js';
import './PatientDetail.css';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

const THINGSPEAK_API_KEY = 'YOUR_API_KEY'; // Replace with your ThingSpeak API key

const PatientDetail = () => {
  const { id } = useParams();
  const [patient, setPatient] = useState(null);
  const [vitals, setVitals] = useState({
    heartRate: 0,
    spo2: 0,
    temperature: 0,
    ecgData: {
      labels: [],
      datasets: [{
        label: 'ECG Reading',
        data: [],
        borderColor: '#4CAF50',
        tension: 0.1
      }]
    }
  });
  const [location, setLocation] = useState({ lat: 51.505, lng: -0.09 });

  // Fetch patient details
  useEffect(() => {
    // Simulating API call for patient data
    const fetchPatientData = async () => {
      // In a real app, this would fetch from an API
      const mockPatient = {
        id: parseInt(id),
        name: "John Doe",
        age: 45,
        channelId: id  // Using patient ID as ThingSpeak channel ID
      };

      setPatient(mockPatient);
    };

    fetchPatientData();
  }, [id]);

  // Fetch ThingSpeak data
  useEffect(() => {
    if (!patient) return;

    const fetchThingSpeakData = async () => {
      try {
        // Fetch the last 20 entries from ThingSpeak
        let THINGSPEAK_API_KEY = "MWFBV98HOZOHTHY4"

        const response = await fetch(
          `https://api.thingspeak.com/channels/${patient.channelId}/feeds.json?api_key=${THINGSPEAK_API_KEY}&results=20`
        );

        if (!response.ok) throw new Error('Failed to fetch data');

        const data = await response.json();
        const feeds = data.feeds;

        if (feeds && feeds.length > 0) {
          const latestFeed = feeds[feeds.length - 1];

          // Update vitals with the latest data
          setVitals({
            heartRate: parseFloat(latestFeed.field1) || 0,  // Heart Rate
            spo2: parseFloat(latestFeed.field2) || 0,       // SpO2
            temperature: parseFloat(latestFeed.field3) || 0, // Temperature
            ecgData: {
              labels: feeds.map(feed => new Date(feed.created_at).toLocaleTimeString()),
              datasets: [{
                label: 'ECG Reading',
                data: feeds.map(feed => parseFloat(feed.field4) || 0), // ECG data
                borderColor: '#4CAF50',
                tension: 0.1
              }]
            }
          });

          // Update location if available
          if (latestFeed.field5 && latestFeed.field6) {
            setLocation({
              lat: parseFloat(latestFeed.field5),
              lng: parseFloat(latestFeed.field6)
            });
          }
        }
      } catch (error) {
        console.error('Error fetching ThingSpeak data:', error);
      }
    };

    // Fetch data every 15 seconds (ThingSpeak's minimum update interval for free accounts)
    const interval = setInterval(fetchThingSpeakData, 15000);
    fetchThingSpeakData(); // Initial fetch

    return () => clearInterval(interval);
  }, [patient]);

  if (!patient) {
    return <div className="loading">Loading patient data...</div>;
  }

  return (
    <div className="patient-detail-container">
      <div className="patient-detail-header">
        <Link to="/" className="back-button">← Back to Dashboard</Link>
        <h2>{patient.name}'s Health Monitor</h2>
        <div className={`status-badge ${patient.status}`}>{patient.status}</div>
      </div>

      <div className="patient-info-section">
        <div className="patient-profile">
          <h3>Patient Information</h3>
          <div className="info-grid">
            <div className="info-item">
              <span className="label">Age:</span>
              <span className="value">{patient.age}</span>
            </div>
            <div className="info-item">
              <span className="label">Gender:</span>
              <span className="value">{patient.gender}</span>
            </div>
            <div className="info-item">
              <span className="label">Blood Type:</span>
              <span className="value">{patient.bloodType}</span>
            </div>
            <div className="info-item">
              <span className="label">Room:</span>
              <span className="value">{patient.room}</span>
            </div>
            <div className="info-item">
              <span className="label">Admission Date:</span>
              <span className="value">{patient.admissionDate}</span>
            </div>
            <div className="info-item">
              <span className="label">Attending Doctor:</span>
              <span className="value">{patient.doctor}</span>
            </div>
          </div>

          <div className="allergies">
            <h4>Allergies</h4>
            <ul>
              {patient.allergies.map((allergy, index) => (
                <li key={index}>{allergy}</li>
              ))}
            </ul>
          </div>

          <div className="diagnosis">
            <h4>Diagnosis</h4>
            <p>{patient.diagnosis}</p>
          </div>
        </div>
      </div>

      <div className="vitals-section">
        <h3>Real-time Vitals</h3>

        <div className="vitals-grid">
          <div className="vital-card heart-rate">
            <h4>Heart Rate</h4>
            <div className="vital-value">{vitals.heartRate} <span className="unit">BPM</span></div>
          </div>

          <div className="vital-card spo2">
            <h4>Oxygen Saturation</h4>
            <div className="vital-value">{vitals.spo2} <span className="unit">%</span></div>
          </div>

          <div className="vital-card temperature">
            <h4>Body Temperature</h4>
            <div className="vital-value">{vitals.temperature} <span className="unit">°C</span></div>
          </div>
        </div>

        <div className="ecg-container">
          <h4>ECG Monitor</h4>
          <div className="ecg-chart">
            <Line data={vitals.ecgData} options={{ responsive: true, animation: false }} />
          </div>
        </div>

        <div className="location-container">
          <h4>Patient Location</h4>
          <div className="map-widget" style={{ height: '300px' }}>
            <MapContainer center={location} zoom={18} style={{ height: '100%', width: '100%' }}>
              <TileLayer
                url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
              />
              <Marker position={location}>
                <Popup>
                  {patient.name} is here <br /> Room: {patient.room}
                </Popup>
              </Marker>
            </MapContainer>
          </div>
        </div>
      </div>
